import React from 'react';
import '../CSS/Home.css';

// const Home=()=> {
//   return (
//     <>
   
//   </>
//   );
// };

const Home = (props) => {
  return (
    <>
    <div>
      <div className="first-page">
        <div className="content">
          <img
            alt="pic204"
            src="/playground_assets/pic204-qgqv-700h.png"
            className={styles['pic']}
          />
          <button className={styles['button']}>
            <button className={styles['king-button']}>
              <span className={styles['text']}>
                <span>Join Now</span>
              </span>
            </button>
          </button>
        </div>
      </div>
    </div>
    </>
  );
};

export default Home;
